import unittestimport calcclass TestCalc(unittest.TestCase):    def  test_add(self):        result = calc.add(10,5)        self.assertEquals(result,15)    def test_subtract(self):        result= calc.subtract(7,5)        self.assertEqual(result,2)    def test_multiply(self):        result= calc.multiply(7,5)        self.assertEqual(result,35)    def test_divide(self):        result= calc.divide(50,5)        self.assertEqual(result,10)        self.assertRaises(ValueError,calc.divide, 3,0)if __name__ == '__main__':    unittest.main()